import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import {
  Box,
  Container,
  Divider,
  Typography,
  Card,
  CardHeader,
  CardContent,
  CardActions,
  Avatar,
  Button,
} from '@material-ui/core';
import ExpansionCard from '../components/ExpansionPanel.js';
import TopMenuBar from '../components/TopMenuBar.js'


const useStyles = makeStyles(theme => ({
  heading: {
    fontSize: theme.typography.pxToRem(15),
    fontWeight: theme.typography.fontWeightRegular,
  },
  section1: {
    margin: theme.spacing(3, 2),
  },
}));

export default function SimpleExpansionPanel() {
  const classes = useStyles();

  return (
    <Container fixed>
      <TopMenuBar block pageName="FAQ" hamburgerMenu={false} closeButtonOnly={false} closeWithPrompt={false} backButton={true} backRoutePage="/"/>
      <Card className={classes.card}>
        <CardHeader
          avatar={
            <Avatar aria-label="nodes" className={classes.avatar}>
              R
            </Avatar>
          }
          title="Nodes FAQ"
          />
          <CardContent>
            <Typography variant="body2">
              Do you have any problems with your nodes? Please navigate here
            </Typography>
          </CardContent>
          <CardActions>
            <Button size="small">Press here</Button>
          </CardActions>
      </Card>
    </Container>
  );
}
